drop database if exists bowls;

create database bowls;

use bowls;

-- foundation tables
create table customer (
    customer_id char(36) primary key,
    first_name varchar(50) not null,
    last_name varchar(50) not null,
	street_address varchar(100) null,
    city varchar(50) null,
    state char(2) null,
    zip_code varchar(5) null,
    email_address varchar(100) not null,
    phone varchar(20) not null,
    date_added date not null,
    reward_points int not null
);

create table item (
    item_id int primary key auto_increment,
    `name` varchar(50) not null,
    `description` varchar(1024) not null,
    price decimal(8,2) not null
);

create table order_status (
    order_status_id int primary key auto_increment,
    `name` varchar(50) not null,
    parent_order_status_id int null,
    constraint fk_order_status_parent_order_status_id
    		foreign key (parent_order_status_id)
    		references order_status(order_status_id)
);

-- related tables
create table `order` (
	order_id int primary key auto_increment,
    order_date datetime not null,
    customer_id char(36) not null,
    order_status_id int not null,
    notes varchar(1024) null,
	constraint fk_order_customer_id
		foreign key (customer_id)
		references customer(customer_id),
	constraint fk_order_order_status_id
    		foreign key (order_status_id)
    		references order_status(order_status_id)
);

create table order_item (
	order_item_id int primary key auto_increment,
    order_id int not null,
    item_id int not null,
    quantity int not null,
    notes varchar(1024) null,
	constraint fk_order_item_order_id
		foreign key (order_id)
		references `order`(order_id),
	constraint fk_order_item_item_id
		foreign key (item_id)
		references item(item_id)
);

create table login (
    customer_id char(36) primary key,
    user_name varchar(100) not null,
    password_hash text not null,
    constraint fk_login_customer_id
		foreign key (customer_id)
		references customer(customer_id)
);



